import React from "react";
import classes from "./Cart.module.css";

const Cart = () => {
  const cartItems = <ul className={classes['cart-items']}>{[
    {
      id: "m1",
      name: "Malai kofta",
      amount: "1",
      price: 16.99,
    },
    {
      id: "m2",
      name: "Palak Paneer",
      amount: "2",
      price: 17.99,
    },
  ].map((meal) => (
    <li>
      <Modal id={meal.id} name={meal.name} amount={meal.amount} />
    </li>
  ))}</ul>;

  return (
    <div>
      {cartItems}
      <div>
        <span>Total Amount:-</span>
        <span>$31.50</span>
      </div>
      <div>
        <button>Close</button>
        <button>Order</button>
      </div>
    </div>
  );
};

export default Cart;
